embedfield:
Filtering a collection against a list of combinations in mongodb<p>We have a collection of users with the following class definition.</p>
<pre><code>public class User
{
    public Guid UserId { get;set; }
    public Guid CompanyId { get;set; }
    public Guid AddressTypeId { get;set; }
    public Guid LocationId { get;set; }
    public Guid DepartmentId { get;set; }
}
</code></pre>
<p>We're trying to query a list of users with a companyId, that matches a list of LocationFilter, with the following class definition.</p>
<pre><code>public class LocationFilter
{
    public Guid AddressTypeId { get;set; }
    public ICollection&lt;Guid&gt; LocationIds { get;set; }
    public ICollection&lt;Guid&gt; DepartmentIds { get;set; }
}
</code></pre>
<p>The querying API definition will look like this:</p>
<pre><code>Task&lt;List&lt;User&gt;&gt; GetUserLocationList(
  Guid companyId, 
  List&lt;LocationFilter&gt; locationFilters);
</code></pre>
<p>I have the following Builder queries if we're querying against a single LocationFilter.</p>
<pre><code>var companyIdFilter = Builders&lt;User&gt;.Filter
  .Eq(user =&gt; user.CompanyId, companyId);
var addressTypeIdFilter = Builders&lt;User&gt;.Filter
  .Eq(user =&gt; user.AddressTypeId, addressTypeId);
var locationIdFilter = Builders&lt;User&gt;.Filter
  .In(user =&gt; user.LocationId, locationIds);
var departmentIdFilter = Builders&lt;User&gt;.Filter
  .In(user =&gt; user.DepartmentId, departmentIds);

var andFilter = Builders&lt;User&gt;.Filter
  .And(
    companyIdFilter, 
    addressTypeIdFilter,
    locationIdFilter,
    departmentIdFilter);

var result = await collection.Find(andFilter).ToListAsync();
</code></pre>
<p>But how do we filter against a list of locationfilter?
Each locationfilter is it's own, it cannot intersect.
For example, all users checked against location filter A, then against location filter B etc.</p>
<p>How can we achieve that using builder queries?
Is this the right approach?</p>

