Aggregation $accumulator + $project<p>Currently, I have a lot of Documents in MongoDB. What I need to do is find every unique field, key, and value, and count the total amount that exist for each.
As an example, if we had the documents:</p>
<pre><code>[{ value1: 'same', value2: 'unique'}, { value1: 'same', value2: 'unique1' }, { value3: 'new' }] 
</code></pre>
<p>The output should be (something along the lines of this - the exact format doesn't matter)</p>
<pre><code>[
    {
        value1: { 
            same: 2, // there are 2 documents with { value1: 'same' }
        },
        value2: {
            unique: 1, // there is 1 document with { value2: 'unique' }
            unique1: 1, // there is 1 document with { value2: 'unique1' }
        },
        value3: {
            new: 1, // there is 1 document with { value3: 'new' }
        },
    }
]
</code></pre>
<p>I'm not sure of a good, performant way to do this with an Aggregation (We could do an &quot;unwind&quot; of all properties, but that's going to create a new Document for each property, then loop over every property, which would be extremely bad for performance)</p>
<p>I have two methods that seem quite close to getting a general idea to work, but I have an issue with both.</p>
<ol>
<li>$function + global variable.</li>
</ol>
<p>If I can loop over every Document and use a global &quot;output&quot; variable, I can simply update this variable for each Document, do the work in JS, and then return the variable at the end.</p>
<p>The &quot;proof of concept&quot; I tried to make for this would be to simply increment a global variable, and then return this variable as the Document.</p>
<pre><code>[{
    // write a custom JS function that has access to the current document
    $replaceRoot: {
        newRoot: {
            $function: {
                body: function (doc: any, TOTAL_COUNT: any) {
                    if (!TOTAL_COUNT) TOTAL_COUNT = 0; // set the initial value
                    TOTAL_COUNT++; // this doesn't truly increment the &quot;$TOTAL_COUNT&quot; variable :(
                    return { total_count: TOTAL_COUNT };
                },
                args: ['$$ROOT', '$TOTAL_COUNT'],
                lang: 'js',
            },
        },
    },
},
]
</code></pre>
<ol start="2">
<li>Accumulator</li>
</ol>
<p>I'm quite certain the &quot;correct&quot; way to do this is with an Accumulator (as those are meant to store persistent information). However, the only methods available with an Accumulator are $group, $bucket, and $bucketAuto.</p>
<p>To the best of my knowledge, none of these allow me to simply &quot;return an output&quot;, similar to $project or $replaceRoot.</p>
<p>I'd be happy to use either an Accumulator or a Function and do the rest myself once I have a proof of concept working :)</p>
<p>Thank you for any help/advice at all! It's greatly appreciated :)</p>

