<pre><code>@Document(&quot;persons&quot;)
@Data
class Person {
    @Id
    private String personId;
    private String name;
    private List&lt;Hobby&gt; hobbies;
}
</code></pre>
<pre><code>@Data
class Hobby {
    private String name;
    private String description;
    private String notImportantField;
}
</code></pre>
<p><strong>Example</strong></p>
<p>I want to get a person with reduced list of hobbies (all the hobbies have to contain searched phrase in one of its field).</p>
<p><em>Person document from the database</em></p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;id1&quot;),
    &quot;name&quot; : &quot;some person&quot;,
    &quot;hobbies&quot; : [
        {
            &quot;name&quot; : &quot;A&quot;,
            &quot;description&quot; : &quot;AB&quot;,
            &quot;notImportantField&quot; : &quot;ABCDEF&quot;
        },
        {
            &quot;name&quot; : &quot;ABC&quot;,
            &quot;description&quot; : &quot;ABCD&quot;,
            &quot;notImportantField&quot; : &quot;ABCDEF&quot;
        }
    ]
}
</code></pre>
<p>What I want to receive:</p>
<ul>
<li>I want person with id <code>id1</code> and I am looking for phrase <code>ab</code> in person's hobbies. I should get <strong>a list with 2 hobbies</strong> (first hobby's description contains <code>ab</code>, second hobby's name and description contains <code>ab</code>)</li>
<li>I want person with id <code>id1</code> and I am looking for phrase <code>d</code> in person's hobbies. I should get <strong>a list with 1 hobby</strong> (second hobby's description contains <code>d</code>)</li>
</ul>
<p>I tried something like this but I get a person with all of its hobbies.</p>
<pre><code>@Repository
interface PersonRepository extends MongoRepository&lt;Person, String&gt; {
    @Query(&quot;{'$and': [&quot; +
                &quot;{'_id': :#{#personId}},&quot; +
                &quot;{'$or':[&quot; +
                    &quot;{'hobbies.name': {$regex: :#{#searchPhraseRegex}, $options: 'i'}},&quot; +
                    &quot;{'hobbies.description': {$regex: :#{#searchPhraseRegex}, $options: 'i'}}&quot; +
                &quot;]}&quot; +
            &quot;]}&quot;)
    List&lt;Person&gt; method(@Param(&quot;personId&quot;) String personId, @Param(&quot;searchPhraseRegex&quot;) String searchPhraseRegex);
}
</code></pre>
<p>The result method should return a person with filtered hobbies or only list of hobbies.
Thanks in advance for help.</p>
<p><strong>UPDATE: RESOLVED</strong></p>
<p>Thanks @user20042973 for the help :) I used your query and change it a little to match my query in Mongo repository. It works as I expected. The result method is:</p>
<pre><code>@Repository
interface PersonRepository extends MongoRepository&lt;Person, String&gt; {
    @Aggregation(pipeline = {
            &quot;{'$match': {'_id': :#{#personId}}}&quot;,
            &quot;{'$addFields':  {'hobbies': {'$filter': {&quot; +
                    &quot;'input': '$hobbies', &quot; +
                    &quot;'cond': &quot; +
                        &quot;{'$or': [&quot; +
                            &quot;{'$regexMatch': {'input': '$$this.name', 'regex': :#{#searchPhraseRegex}, 'options': 'i' }},&quot; +
                            &quot;{'$regexMatch': {'input': '$$this.description', 'regex': :#{#searchPhraseRegex}, 'options': 'i' }}&quot; +
                        &quot;]}&quot; +
                    &quot;}}}}&quot;
    })
    Optional&lt;Person&gt; findPersonByIdAndFilterHobbies(@Param(&quot;personId&quot;) String personId, @Param(&quot;searchPhraseRegex&quot;) String searchPhraseRegex);
}
</code></pre>
<p>Note: For searching e.g. <code>ab</code> we need to pass <code>.*ab.*</code> as a method argument <code>searchPhraseRegex</code>.</p>; Answer: (1) Print out `$sql` after variable substitution and the answer will probably be obvious.  (2) Learn to use parameters.  Munging variables into a query string is just asking for trouble and for unexpected syntax errors in queries.

