<p>Thank you!</p>; Answer: One final note - the Vtable wasn't on the objects themself (like in C++), but on the *class* of the object. Because objective-c already had metatypes, there was no real reason to do the vtables at the object level like C++ does. It does mean there's an extra level of indirection (and cache misses), which probably also didn't help vtables case once method caching was around.

